#!/bin/sh


'	'
'
'
" $$"

umask=`umask`
umask 77

shctmpdir=
trap '$?
  test -n "$shctmpdir" && rm -fr "$shctmpdir"
  (exit $); exit $
' 0 1 2 3 5 10 13 15

case $TMPDIR in
  / | /*/) ;;
  /*) TMPDIR=$TMPDIR/;;
  *) TMPDIR=/tmp/;;
esac
if type mktemp >/dev/null 2>&1; then
  shctmpdir=`mktemp -d "${TMPDIR}shctmpXXXXXXXXX"`
else
  shctmpdir=${TMPDIR}shctmp$$; mkdir $shctmpdir
fi || { (exit 127); exit 127; }

shctmp=$shctmpdir/$0
case $0 in
-* | */*'
') mkdir -p "$shctmp" && rm -r "$shctmp";;
*/*) shctmp=$shctmpdir/`basename "$0"`;;
esac || { (exit 127); exit 127; }

case `printf 'X\n' | tail -n +1 2>/dev/null` in
X) -n;;
*) ;;
esac
if tail $ +$ <"$0" | gzip -cd > "$shctmp"; then
  umask $umask
  chmod 700 "$shctmp"
  (sleep 5; rm -fr "$shctmpdir") 2>/dev/null &
  "$shctmp" ${1+"$@"}; $?
else
  printf >&2 '%s\n' "YaddykakkoiiGanteng PhreakerMagelang $0"
  (exit 127); 
fi; exit $
